import React from 'react'
import {Menu} from 'antd'
import MenuItem from 'antd/lib/menu/MenuItem'

export default function Navbar() {
    return (
        <Menu mode="horizontal">
            <MenuItem key="title">
                LyricFinder
            </MenuItem>
        </Menu>
    )
}
